import React from "react";
import { VictoryBar, VictoryChart, VictoryLabel, VictoryTheme } from "victory";

function MonthlyHours() {
  return(
    <VictoryChart
      theme={VictoryTheme.material}
      domainPadding={400}
      width = {900}
    >
      <VictoryLabel x={25} y={24} style={styles.title}
        text="Job Frequency"
      />
      <VictoryBar
        style={{ data: { fill: "#c43a31" } }}
        // data={sampleData}
        data={[
          {x: "house chores", y: 1},
          {x: "shopping", y: 2},
          {x: "beautification", y: 3},
          {x: "children care", y: 2},
          {x: "pet care", y: 1}
        ]}
      />
    </VictoryChart>
  );

}
const styles = StyleSheet.create({
  title: {
    textAnchor: "start",
    verticalAnchor: "end",
    fill: "#000000",
    fontFamily: "inherit",
    fontSize: "24px",
    fontWeight: "bold"
  },
});
export default MonthlyHours;
